  return (
    <div className="sidenav-container">
        <div className="main-icon">
            <TrackerIcon/>
        </div>

        <div className="main-tabs_container">
        <div className="main-icon">
            <TrackerIcon/>
        </div>
        </div>
    </div>
  );
};

export default Sidenav;
